import HostSearchList from "./HostList";
import HostSearchOption from "./HostSearchOption";

const HOSTS = [
    { id: "e1", title: "event 1" },
    { id: "e2", title: "event 2" },
    { id: "e3", title: "event 3" },
  ];

 function HostSearch() {
    return (
        <>
            <HostSearchOption />
            <HostSearchList hosts={HOSTS} />
        </>
    )
 } 

 export default HostSearch;
